import React,{useEffect} from 'react'



function Dashboard() {
  useEffect(() => {
    const loggedInUser = localStorage.getItem("user");
    if (loggedInUser) {
      const foundUser = JSON.parse(loggedInUser);
      setUser(foundUser);
    }
  }, []);
  
  return (
    <div>
       Dashboard</div>
  )
}

export default Dashboard
